  the United States Geological Survey (USGS) in conjunction with the National Park
  Service (NPS) Inventory and Monitoring Program. The USGS/BRD is responsible for
  overall management and oversight of all ongoing mapping efforts. This mapping effort
  was performed by the U.S. Bureau of Reclamation's (USBR) Remote Sensing and GIS
  Group, Technical Service Center, Denver, Colorado and NatureServe (formally The
  Nature Conservancy).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
